import React, {Component, Fragment} from 'react';
import Input from '@material-ui/core/Input';

class InputComponent extends Component {

    constructor(props) {
        super(props);
    }

    render() {

        return (
            <Fragment>
                <Input type={"text"} />
            </Fragment>
        )
    }
}

export default InputComponent;
